def reverse(x):
    num = abs(x)
        
    rev = 0
    
    while num != 0:
        ld = num % 10
            
        # Overflow check
        if rev > (2 ** 31 - ld) // 10:
            return 0
            
        rev = rev * 10 + ld
        num = num // 10
        
    if x < 0:
        rev = -rev
        
    return rev


